package com.example.cardview

import android.annotation.SuppressLint
import android.app.AlertDialog
import android.content.Context.WINDOW_SERVICE
import android.graphics.Bitmap
import android.graphics.Point
import android.os.Bundle
import android.util.DisplayMetrics
import android.view.*
import android.widget.ImageView
import android.widget.LinearLayout
import android.widget.Toast
import androidx.constraintlayout.widget.ConstraintLayout
import androidx.fragment.app.Fragment
import com.google.android.material.floatingactionbutton.FloatingActionButton


/**
 * A simple [Fragment] subclass as the default destination in the navigation.
 */
class FirstFragment : Fragment() {

    var count=0//レイアウト追加管理用


    override fun onCreateView(
            inflater: LayoutInflater, container: ViewGroup?,
            savedInstanceState: Bundle?
    ): View? {
        // Inflate the layout for this fragment
        return inflater.inflate(R.layout.fragment_first, container, false)
    }

    override fun onViewCreated(view: View, savedInstanceState: Bundle?) {
        super.onViewCreated(view, savedInstanceState)

        //fabボタンリスナー
        view.findViewById<FloatingActionButton>(R.id.fab_add).setOnClickListener{
            //ボタンが押されたら通信が成功したと仮定して動作を作りました
            layout_add(view,getFriendData())
        }
    }

    //レイアウト追加用関数
    //Fragmentでの処理のためViewを引数として受け取る（findViewById等に利用するため）
    @SuppressLint("CutPasteId")
    fun layout_add(view: View,list:List<MyApp.CARDDATA>) {

        //スクロールビューのifを取得しビューグループに変換
        val SV: ViewGroup = view.findViewById<View>(R.id.sv) as ViewGroup

        //リストを削除する
        SV.removeAllViews()

        count=0

        //リストの件数分回す
        for(i in list.indices step 3){

            //レイアウトデータを読み込み追加する
            getLayoutInflater().inflate(R.layout.cardpage, SV)

            //今回追加したレイアウトのデータを取得
            val layout: ConstraintLayout = SV.getChildAt(count) as ConstraintLayout

            //レイアウトにタグをつけて後で扱いやすくする
            layout.setTag(count)

            val card1=(layout.findViewById<LinearLayout>(R.id.innnerlayout).getChildAt(1)as ImageView)

            val card2=(layout.findViewById<LinearLayout>(R.id.innnerlayout).getChildAt(3)as ImageView)

            val card3=(layout.findViewById<LinearLayout>(R.id.innnerlayout).getChildAt(5)as ImageView)

            card1.setImageBitmap(MyApp().CreateCardBitmap(list[i],resources))

            card2.setImageBitmap(MyApp().CreateCardBitmap(list[i+1],resources))

            card3.setImageBitmap(MyApp().CreateCardBitmap(list[i+2],resources))

            card1.setOnClickListener{
            }
            card2.setOnClickListener{
            }
            card3.setOnClickListener{
            }

            //カウントを追加する
            count++

        }

    }

    //通信してフレンドのユーザーデータを取得する関数（だと思ってください）
    //戻り値:USERDATA型リスト
    fun getFriendData():List<MyApp.CARDDATA> {
        var list=mutableListOf<MyApp.CARDDATA>()
        list.add(MyApp.CARDDATA(12345,
                "あいうえお",
                testBitmapData(),
                30,
                503500,
                3,
                1,
                1,
                "あいうえおかきくけこさしす",
                0))
        list.add(MyApp.CARDDATA(45624,
                "なまえ",
                testBitmapData(),
                18,
                25000,
                2,
                2,
                3,
                "コメント",
                0))
        list.add(MyApp.CARDDATA(78454,
                "どなたか",
                testBitmapData(),
                24,
                471140,
                1,
                4,
                2,
                "植田がんばって",
                0))
        return list
    }


//※仮で読み込むデータを作ってるだけです
    fun testBitmapData(): Bitmap? {
        val str1=""
        val str2=""
        val str3=""
        val str4=""
        val str5=""
        val str6=""
        val str7=""

        val bit: Bitmap? =MyApp().IconBitmapCreate(str1+str2+str3+str4+str5+str6+str7)
        return bit
    }

}